import React from "react";
import './sumary.css'
function Sumary () {

    return(
        <div className="fundo">
            <div className="sumary"><h1>
            Olá meu nome é Carlos Henrique Pizzi, nascido em 31 de maio de 2000 no interior de São Paulo. Atualmente com 22 anos de idade, tenho uma forte ligação com a tecnologia, tendo sido influenciado  desde criança por meu primo e amigos. Eu sou uma pessoa curiosa e apaixonada por aprender, consequência disso aos meus 11 anos eu já tinha um conhecimento em informática,
             hardwares, redes etc. E escolhi essa área para me profissionalizar por ser sempre muito próximo a tecnologia e por influência de várias pessoas.
            </h1>
            </div>
            <button>BAIXAR CV</button>
        </div>
    )
}

export default Sumary
